вно искала полотенце, которое хорошо впитывает влагу! Супер мягкое.  Всем рекомендую к заказу!", "2019-09-18T12:02:28.888909868Z", "бежевый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "365": ["Цвет  как на картинке, приятный, действительно лимонный. Бирка  с составом и рекомендациями по уходу.  Производство  Индия.  Единственное, что полотенце  средней плотности, кто ищет  супер  пушистое и мохнатое, не оправдает  ожиданий. Я  ожидала  обычное полотенце  ,его и получила ).", "2019-09-17T16:34:10.170344211Z", "желтый", "0", 3, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "370": ["Качество отличное, очень мягкое, приятно к телу. Цвет после стирки не поменяло, ворсинки не летят. \nВпитывает очень хорошо. Советую брать, не пожалейте. Буду заказывать ещё.", "2019-09-12T16:05:16.116880057Z", "синий", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "371": ["Чудесные полотенца, взяла два, закажу ещё!", "2019-09-12T14:32:24.710211804Z", "желтый", "0", 1, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "374": ["Хорошее, качественное полотенце, пользуемся несколько месяцев, очень довольна покупкой.", "2019-09-06T19:24:10.899867669Z", "желтый", "0", 1, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "375": ["По составу 25% бамбук, 75% хлопок", "2019-09-06T13:03:25.829716482Z", "малиновый", "0", 5, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "376": ["Отличное полотенце. Цвет как на фото, мягенькое, не толстое. Я такое и хотела, не тяжелое. Брала со скидкой, огромная благодарность магазину за такой подарок.", "2019-09-05T08:25:45.113084198Z", "салатовый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "377": ["Полотенце понравилось. Еще не стирала. Качество хорошее, поэтому думаю после стирки будет все нормально.", "2019-09-04T13:45:10.389076152Z", "синий", "0", 0, 2, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "378": ["Замечательное полотенце. Хорошо впитывает. Нитки не лезут. Не линяет. ", "2019-09-04T11:57:21.496607519Z", "желтый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "379": ["Отличное полотенце, приятное к телу, хорошо впитывает. Среднее по толщине, сохнет норм. Цвет насыщенный, не режет глаз! Очень понравилось! Спасибо любимому магазину!", "2019-09-04T04:19:55.054373355Z", "сиреневый", "0", 1, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "380": ["Качественное и красивое. После стирок не деформируется.\nЕсли бы были петельки для крючков, цены бы ему не было.\nВзяли 2 цвета (светло- и темно- зелёные). Приятные не броские цвета.", "2019-09-01T20:37:04.39088585Z", "салатовый", "0", 4, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "381": ["Хорошие качественные полотенца, заказывала зелёное, салатовое и жёлтое себе и маме, мы в восторге  всем рекомендую!", "2019-09-01T16:32:44.696577984Z", "зеленый", "0", 3, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "382": ["Брала в первый раз, доверилась отзывам покупателей и не зря! Качество полотенец на высоте👍 брала малиновый и синий, на фото уже постиранные полотенца, цвет не поменяли, не полиняли, остались такие же мягкие. Спасибо фирме Ecotex и магазину WB", "2019-09-01T08:36:15.227877791Z", "малиновый", "0", 6, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "387": ["Полотенце покрылось жёлтыми пятнами после вытирания. Ещё даже ни разу не стирала. Полистала отзывы и, действительно, такое встречается, прилагаю скрины. Почему-то производитель не реагирует.  В целом, полотенце приятное и мягкое, но, видимо, бракованная партия. Надеюсь, Ecotex заметят мой отзыв.", "2019-08-30T07:56:02.527400013Z", "бежевый", "0", 16, 11, 1, "Полотенце \"Бамбук\"", "ECOTEX"], "388": ["Хорошее полотенце,мягкое, ворс ровный. После стирки цвет остался прежним", "2019-08-28T17:56:01.196334783Z", "желтый", "0", 4, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "389": ["Хорошее,мягкое полотенце.  Соответствует описанию.", "2019-08-28T17:55:01.384629973Z", "малиновый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "390": ["Классные полотенца, качество на высоте. Плотненькие, впитывают влагу отлично. Будем заказывать ещё:)", "2019-08-28T10:53:48.846971308Z", "синий", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "391": ["Полотенце скорее синее, чем голубое. Ворс небольшой, мягкий. Лишних ниток нет. Прошито аккуратно. Запах небольшой при первом открытии. Размер 70*130. Есть инструкция по уходу.  первое впечатление - отличное полотенце. После использования дополню.", "2019-08-24T10:10:14.668592489Z", "голубой", "0", 10, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "393": ["Цвет Салатовый и сиреневый радуют глаз на ощуп после стирки стали объемнее,мягкие то что надо,полоска-вставка не жесткая, рекомендую!", "2019-08-24T08:56:42.405857844Z", "салатовый", "0", 3, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "394": ["Когда взяла в руки в пункте выдачи были сомнения, потому что до этого пользовалась только 100% хлопок, но постирав при 40 град. порошком для цв.белья и вытираться им приятно, осталась очень довольна этим составом. Рекомендую тем кто сомневается.", "2019-08-24T03:08:08.391793441Z", "салатовый", "0", 6, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "398": ["Отличное полотенце ,очень понравилось ,буду заказывать еще.", "2019-08-21T05:26:28.403792928Z", "желтый", "0", 1, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "399": ["Полотенце очень понравилось, обязательно закажу ещё другого цвета. ", "2019-08-20T14:21:02.517755718Z", "персиковый", "0", 7, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "400": ["Довольна! Очень мягкое, красивое!", "2019-08-20T11:16:27.599810334Z", "персиковый", "0", 4, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "401": ["После стирки цвет не изменился, очень мягкое полотенце ) надеюсь в применении будет таким же суперским 🙈 буду заказывать ещё  ", "2019-08-19T21:00:55.701866089Z", "малиновый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "402": ["Оставляет ворсинки (((", "2019-08-19T20:45:49.649142102Z", "желтый", "0", 1, 2, 4, "Полотенце \"Бамбук\"", "ECOTEX"], "403": ["Полотенце мягкое. Но цвет совсем не совпадает с фотографией. По факту - серо-зеленый, бледный. Грязноватый.", "2019-08-19T12:03:47.973435192Z", "морская волна", "0", 0, 1, 3, "Полотенце \"Бамбук\"", "ECOTEX"], "404": ["Отличное полотенце, доя всей семьи купила уже. Впитывает хорошо, мягкое после стирки, не оставляет ворсинки на теле. Всем советую)", "2019-08-19T10:54:02.902470147Z", "голубой", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "405": ["Хорошее полотенце, быстро впитывает влагу, размер идеальный. Использовала пару раз, 1 раз стирала в машине, качество хорошее.", "2019-08-19T09:25:45.103766931Z", "малиновый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "408": ["Пока не стирала", "2019-08-18T05:47:11.321706328Z", "салатовый", "0", 0, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "410": ["Хорошее понравилось ", "2019-07-25T18:18:50.567774693Z", "персиковый", "0", 0, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "412": ["Хорошее качество. Без недостатков", "2019-08-17T15:16:06.342472907Z", "салатовый", "0", 3, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "413": ["Плотное и мягкое полотенце, очень понравилось.", "2019-08-16T17:21:46.90465553Z", "бежевый", "0", 2, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "414": ["Полотенце приятное, мягкое, но цвет как застиранный, не яркий, возврат.", "2019-08-16T17:12:04.158363867Z", "малиновый", "0", 2, 0, 4, "Полотенце \"Бамбук\"", "ECOTEX"], "415": ["Уже не первое такое полотенце заказываю! Мягкие не линяют!", "2019-08-16T12:53:47.173767525Z", "персиковый", "0", 2, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "416": ["Очень хорошее полотенце, мягкое. Покупкой довольна.", "2019-08-15T11:59:58.875623636Z", "зеленый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "417": ["Мягкие, лохматенько-пушистые. Стирала. Не линяют. Впитывают хорошо. Приятные. Взяла три разных неярких цветов. Понравились.", "2019-08-14T23:50:34.274015107Z", "сиреневый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "418": ["Замечательное большое банное полотенце. Плотное, мягкое, хорошо впитывает влагу. Петельки ровные и плотные. После стирки своих качеств не потеряло", "2019-08-13T08:17:11.1263639Z", "синий", "0", 2, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "419": ["Отличное качество!!", "2019-08-12T18:41:14.102704921Z", "сиреневый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "421": ["Отличное качество заказала второй 🌸", "2019-08-11T12:47:55.97483701Z", "голубой", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "422": ["Присоединяюсь ко всем положительным отзывам. Пушистое, приятное, купила синие. Заказала ещё в другом цвете. Хочу все цвета)", "2019-08-10T13:16:09.93104855Z", "синий", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "423": ["Отличное качество полотенца, бамбук. Цена адекватна размеру полотенца. Спасибо WB и производителю за скидки.", "2019-08-07T15:48:31.609562796Z", "салатовый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "424": ["Мягкое, пушистое полотенце. Не линяет, хорошо впитывает. Очень довольна покупкой. Спасибо производителю и WB", "2019-08-06T19:46:42.837666315Z", "салатовый", "0", 2, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "425": ["Полотенца впитывают лучше, чем обычные из 100% хлопка, всё благодаря присутствию в составе бамбуковых волокон. Ещё один плюс присутствия бамбука в составе -  мягкость. В первый раз покупала такие в магазине, лет пять назад, когда в составе было 35% бамбука и 65% хлопка, на мой взгляд, изделие было плотнее по ощущениям. Сейчас изготовлены немного в другом соотношении бамбук+хлопок. Не смотря ни на что, очень довольна, буду заказывать еще. На ярлыке есть рекомендации по стирке от производителя. Очень качественное исполнение. Рекомендую к покупке.", "2019-03-04T12:40:09.003314924Z", "желтый", "0", 3, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "429": ["Очень понравилось полотенце, мягкое и качественное", "2019-08-05T08:03:00.723851811Z", "персиковый", "0", 0, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "430": ["Отличное качество, мягкое и цвет красивый. Закажу ещё несколько полотенец других цветов. ", "2019-08-04T16:06:23.858404956Z", "салатовый", "0", 7, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "431": ["Жена купила два полотенца:желтое и малиновое. Очень хорошо впитывают,мягкие,приятные.Закажем ещё", "2019-08-04T14:44:09.864088023Z", "желтый", "0", 4, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "433": ["Полотенца мягкие , впитывают хорошо . за эти деньги вполне хорошее качество . я рада . Брала три разных цвета . все отлично .после стирки цвета на месте", "2019-08-03T17:52:25.011304352Z", "синий", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "434": ["Отличные полотенца, мягкие, приятные, натуральные.", "2019-08-03T17:16:24.478371342Z", "малиновый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "435": ["Полотенце классное, очень мягкое, впитывает хорошо, махнушки не летят. Я довольна. До этого бамбуковое полотенце покупала в Турции, это даже толще. Спасибо магазину за возможность купить такие  качественные вещи.", "2019-03-22T08:45:27.179333044Z", "бирюзовый", "0", 3, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "437": ["Отличное полотенце , очень мягкое ", "2019-08-02T14:19:22.251866003Z", "синий", "0", 4, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "438": ["Полотенце очень хорошее, мягкое. Полностью соответствует описанию. Цвет пастельный. Купила ещё и салатовое..Каждое полотенце упаковано в пакет. Можно и на подарок. Рекомендую.", "2019-08-01T16:53:02.531357771Z", "желтый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "439": ["Заказала 2 цвета: морской волны и жёлтое. 1-ое оказалось бледно-бледно-зеленым, 2-ое - светло желтеньким, веселенькое. Мягкие. Качество отличное. За такие деньги так вообще подарок.", "2019-07-31T23:42:00.001960282Z", "желтый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "443": ["Цвет немного бледнее на самом деле. Но все равно красивое полотенце.Мягкое,хорошо впитывает) Лучшее, что у меня были!", "2019-07-31T06:31:22.338732092Z", "персиковый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "446": ["Полотенце изумительное, после стирки осталось мягким, без смягчителя. Толстенькое, качественно сшито", "2019-07-30T14:54:55.546372584Z", "желтый", "0", 0, 3, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "448": ["Хорошее полотенце. \r\nОчень мягкое, отличное впитывает.", "2019-07-28T11:23:45.735456591Z", "салатовый", "0", 1, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "452": ["Купила два полотенца светло-зеленое и голубое... Цвета приятные, сами полотенца мягкие, пушистые, хорошо впитывают влагу... Мне очень понравились", "2019-07-26T09:44:46.859735555Z", "салатовый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "453": ["Полотенце отличное!!! Спасибо магазину.", "2019-07-26T07:44:21.356427711Z", "зеленый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "454": ["Отличные полотенца!Со своей функцией справляются!Размер хороший!Рекомендую!", "2019-07-26T06:51:38.135641958Z", "персиковый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "456": ["Шикарное полотенце, впитывпет моментально, взяла разные цвета, не красится и не оставляют ворсинки", "2019-07-25T06:54:23.693068244Z", "синий", "0", 3, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "458": ["Полотенце хорошее, пушистое. Рекомендую", "2019-07-22T19:07:35.802267986Z", "персиковый", "0", 1, 0, 4, "Полотенце \"Бамбук\"", "ECOTEX"], "461": ["Я таки влюблена в эти полотенца. Мягкие, впитывают воду моментально.", "2019-07-19T22:52:20.511687085Z", "морская волна", "0", 1, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "462": ["Полотенце хорошо 👍мягкое, впитывает👌рекомендую 💛", "2019-07-16T08:51:44.438084548Z", "салатовый", "0", 2, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "463": ["Отличные полотенца (малиновое и зеленое) - пушистые и мягкие, красивые цвета. Я довольна, благодарю.", "2019-07-15T10:04:03.107900473Z", "малиновый", "0", 2, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "464": ["Отличное полотенце. Цвет отличается от фото", "2019-07-14T10:52:48.574135771Z", "бирюзовый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "466": ["Неоднократно приобретала бамбуковые полотенца, но не на WB, решила купить здесь. Мягкое, толстое, красивого цвета полотенце обязательно порадует мою дочку-неженку.Сама обожаю жесткие.Рекомендую к покупке.", "2019-07-13T19:13:45.827384666Z", "сиреневый", "0", 2, 1, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "467": ["Очень хорошее полотенце", "2019-07-13T06:19:27.483733479Z", "синий", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "469": ["Полотенце отличного качества. Взяла внучке в бассейн. Мягкое и легкое, хорошо впитывает остатки воды. Рекомендую", "2019-07-13T05:29:53.597469743Z", "зеленый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "470": ["Хорошее полотенце для своей стоимости,пришло в пакете,без затяжек.", "2019-07-12T20:36:48.983954598Z", "желтый", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "474": ["Отличный товар. Очень доволен качеством.", "2019-07-09T14:00:01.916957581Z", "синий", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "475": ["Полотенце очень понравилось. Цвет насыщенный, больше светло-фиолетовый. Мне такой оттенок и нужен был. Качество отличное. Мягкое, нежное, приятное на ощупь.", "2019-07-08T16:23:25.892584914Z", "сиреневый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "476": ["мягкое и тоненькое на лето самое оно", "2019-07-08T09:47:43.207251784Z", "синий", "0", 2, 2, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "477": ["Полотенце замечательно впитывает влагу. Мягкое, на мой взгляд немного тоньше, чем 100% хлопковые полотенца. Кайма с рисунком с одного края.", "2019-07-07T21:12:12.923271287Z", "сиреневый", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "478": ["Шикарное! Сначала цвет морской волны мне показался грязноватым, но потом в него влюбилась. Спокойный нейтральный цвет, не люблю кричащие пятна в ванной. Полотенце густое, очень мягкое, приятное для тела, одно удовольствие использовать.", "2019-07-04T07:34:07.666928976Z", "морская волна", "0", 1, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"], "479": ["Качество отличное, довольна. Отказалась от голубого ,взяла синее.", "2019-07-02T08:44:50.318365074Z", "синий", "0", 2, 0, 5, "Полотенце \"Бамбук\"", "ECOTEX"